import './Tab1.css'
import * as React from 'react';
import Autocomplete from '@mui/material/Autocomplete';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Button from '@mui/material/Button';
import Table from '../../components/table/table';
import {Context} from '../../controller/info'
import {useEffect} from 'react';


export default function Tab1() {
  const main = ['Main Ranking 1','Main Ranking 2'];
  const add = ['Additional Ranking 1', 'Additional Ranking 2'];
  const states = ['State 1', 'State 2'];

  const user = React.useContext(Context)
  const [mainRanking,setMainRanking] = React.useState('')
  const [additionalRanking,setAdditionalRanking] = React.useState('')
  const [weight,setWeight] = React.useState(1)

  useEffect(() => {
    window.localStorage.setItem("data", user.info)
    const currentUser = window.localStorage.getItem("data")
    console.log(window.localStorage["data"])
  })

  return (
    <section id = "tab1">
      <h1>Welcome to Tab 1.</h1> 
      <div className='box'>
        <div className ='ranking'>
          <div className='filter-header'>Select your Ranking</div>
          <Autocomplete
            disablePortal
            id="combo-box-demo"
            className='tab'
            options={main}
            sx={{ width: 550 }}
            renderInput={(params) => <TextField {...params} label="Choose Main Ranking" />}
            onChange = {e => setMainRanking(e.target.innerHTML)}
          />
          <Autocomplete
            disablePortal
            id="combo-box-demo"
            className = 'tab'
            options={add}
            sx={{ width: 550 }}
            renderInput={(params) => <TextField {...params} label="Choose Additional Ranking (Optional)" />}
            onChange = {e => setAdditionalRanking(e.target.innerHTML)}
          />
          <TextField id="outlined-basic" label="Weight" sx={{ width: 550 }} variant="outlined"
            onChange = {e => setWeight(parseFloat(e.target.value))} />
          <br></br>
          <Button variant="contained"sx={{ width: 550 }}
            onClick = {() => {
              const temp = user.info
              temp.push({
                main : mainRanking,
                add : additionalRanking,
                weight : weight
              })
              user.updateInfo(temp)
            }}>
              Add
            </Button>
        </div>
        <div className ='filter'>
          <p className = 'filter-header'>Filter Options</p>
          <div>
            <div className='filter-header'>Setting</div>
            <FormControlLabel control={<Checkbox />} className = 'label' label="Urban" />
            <FormControlLabel control={<Checkbox />} className = 'label' label="Suburban" />
            <FormControlLabel control={<Checkbox />} className = 'label' label="Rural" />
          </div>
          <div>
            <div className='filter-header'>Private/Public</div>
            <FormControlLabel control={<Checkbox />} className = 'label' label="Private" />
            <FormControlLabel control={<Checkbox />} className = 'label' label="Public" />
          </div>
          <div>
            <div className ='filter-header'>Location</div>
            <Autocomplete
            disablePortal
            id="combo-box-demo"
            options={states}
            sx={{ width: 300 }}
            renderInput={(params) => <TextField {...params} label="States" />}
            />
          </div>
        </div>
      </div>
      <div className = 'search'>
        <Button variant="contained"sx={{ width: 300 }}>Search</Button>
      </div>
      <Table></Table>
    </section>
  );
}
